INSERT INTO `listings` VALUES (3,'should','95062','1641 Schooner Ct.','Santa Cruz','CA',575000,486800,'4','3',3920,1937,432000,'2011-10-13','normal','agent','once',14,'Steve Noren, Thunderbird RE',0,0,'Built: 1989\r\nMLS: 81201853\r\n\r\nBreathing room! spacious, airy 4br home (or 3br+den)completely refurbished and modernized with upscale granite and tile counters and baths w/creative and lovely tile showers, new carpets throughout, new paint, double glazed windows, greenhouse window, new appliances, and best of all, new roof! all Aooms are oversized, huge lr and dr, larger bedrooms. great location:cul de sac/with ez access to fwy.','2012-02-01 00:00:00','2012-02-06 19:50:18','(831) 824-4914','',0,'http://www.zillow.com/homes/1641-Schooner-Ct.,-Santa-Cruz,--CA_rb/','1641Schooner-3.jpg'),(4,'should','95062','2319 Byer Rd.','Santa Cruz','CA',569000,630000,'4','3',6098,2214,445000,'2000-02-29','normal','agent','once',164,'Patti Boe',0,0,'3 price reductions, down from 645000 to 619000 to 599000 to 569000\r\nOther agents: Rick Mirtz (877) 530-1750, Adam Andrus American Dream, Realty (831) 566-8075\r\nNewly installed wood flrs in liv & family rooms. Exceptional quiet location & value. High ceiling. Good floorplan in this 12-yr old development. Fireplace in family room. Separate dining area. Hugh private back yard with custom patio,BBQ, Fruit trees, vege garden & composting area. Lots of house for the money. No HOA fees. Co-list with May Chan, Rick Wilkins & Asso. Brokered By: American Dream RealtyListing Agent: Patty Connle\r\nMLS# 81136503\r\n\r\n8 total rooms\r\nBuilt in 2000\r\n\r\n','2012-02-02 04:26:58','2012-02-03 18:00:28','(831) 325.2553','',0,'http://www.zillow.com/homedetails/2319-Byer-Rd-Santa-Cruz-CA-95062/51474392_zpid/','2319Byer-4.jpg'),(5,'should','95062','1805 Silvana Ln.','Santa Cruz','CA',547500,502300,'3','3',3920,1615,415500,'2012-11-22','normal','agent','once',12,'Steve Noren, Thunderbird Real Estate',0,0,'Built: 1987\r\nMLS# 81202362\r\n\r\nComfortable & elegant, fully refurbished better than new! huge master suite w/hardwood floors, beautifully designed tile showers, exquisite granite counters in baths, tile counters in kitchen, newly painted both in and out, great location, walking distance to beach. new, upscale lighting, extensive use of crown molding, efficiency fireplace w/black quartz hearth, new appliances.no show until 1/22 \r\n\r\n\r\n\r\n','2012-02-02 04:34:40','2012-02-06 20:08:47','','(831) 824-4914',0,'http://www.zillow.com/homedetails/1805-Silvana-Ln-Santa-Cruz-CA-95062/16127884_zpid/','1805Silvana-5.jpg'),(6,'should','95062','101 Oak Leaf Ct.','Santa Cruz','CA',589000,592000,'3','2',6098,1600,0,'2012-02-02','normal','agent','once',13,'Montalvo Homes & Estates',0,0,'Built: 2012\r\nMLS# 81201890\r\n\r\nBuyers Agents: # Nick Llewellyn (855) 414-6870, Rick Mirtz (877) 530-1750\r\n4 New Arts & Crafts Bungalow Style Homes for Sale! New Construction with Classic Santa Cruz Character and Charm! Spacious 3 Bed/ 2 Bath, 1600 Sqft., Granite Counters, Stainless Steel Appliances, Gas Fireplaces, On Demand H20 Heater, Open Floor Plan, Oversize Garages, Fruit trees, Private Cul-de-sac., Est. Completion date Spring 2012. Hurry and select your upgrades now! Brokered And Advertised By: Montalvo Homes & EstatesListing Agent: Derek Timm','2012-02-02 04:39:33','2012-02-06 20:11:38','','(831) 460-4663',0,'http://www.zillow.com/homedetails/101-Oak-Leaf-Ct-Santa-Cruz-CA-95062/2121929480_zpid/','101OakLeaf-6.jpg'),(7,'should','95010','1785 42nd Ave.','Capitola','CA',529000,557600,'3','2',4791,1685,732100,'2005-02-28','normal','agent','twice',29,'Real Estate Eight Three One',0,0,'Built: 1989\r\n\r\n\r\nCapitola 3 bedroom 2 bath single level home. Hardwood floors throughout. Newly painted inside and out and new front yard landscaping. Not a short sale or bank owned. Within walking distance to 41st Avenue shopping. This one will go fast. [Listing information © MLSListings Inc. All rights reserved.]Brokered And Advertised 