n floorplan, newer paint and roof. Enjoy tripple decks. Watch the spectacular sun settings from the upper deck. Master bedroom opens to the deck. Enjoy beautifully landscaped backyard w/various fruit trees.\r\n\r\n\r\n','2012-02-02 18:12:03','2012-02-06 19:57:31','','',0,'http://www.zillow.com/homedetails/520-Santa-Marguarita-Dr-Aptos-CA-95003/16140798_zpid/','520SantaMarguerita-11.jpg'),(12,'should','95003','531 Humes Ave.','Aptos','CA',637500,582600,'3','2',4791,1558,485000,'2001-09-18','normal','agent','once',22,'Carol VanAusdal, Keller Williams',0,0,'ice sunny home in desirable Rio Del Mar neighborhood. Separate living room w/gas fireplace, open kitchen/dining/family room. Master suite with jacuzzi tub, wonderful back patio great for entertaining. Home completely upgraded inside and out 10 years ago. French drains, tile driveway, extra parking space, newer roof, ready to move in. Close to Seascape Golf, Deluxe Foods, and Hidden Beach.\r\n\r\nListing source:	Keller Williams Realty\r\nBrokerage:	Keller Williams - Santa Cruz\r\nBrokerage phone:	(831) 457-5500','2012-02-02 18:24:08','2012-02-03 17:56:14','','(831) 457-5500',0,'http://www.zillow.com/homedetails/531-Humes-Ave-Aptos-CA-95003/16140688_zpid/','531Humes-12.jpg'),(13,'should','95003','10024 Monroe Ave.','Aptos','CA',625000,604900,'4','3',16552,2372,527000,'2001-04-16','normal','agent','once',119,'Janice Boardman, American Dream',0,0,'Beautiful Aptos 3 bedroom home with large 1 bedroom guest house. This home features wonderful tile work through out, re-roofed 2 yrs ago & new exterior paint. Large tiled balcony off the dining room. Has a great large back yard with wonderful covered patio, approx 1/3 acre great for gardening, kids & dogs. Great lay out well kept. Central location close to bus, shopping, etc.\r\n\r\nMLS #: 	81141949','2012-02-02 18:29:22','2012-02-03 17:55:56','','(831) 429-5700',0,'http://www.zillow.com/homedetails/10024-Monroe-Ave-Aptos-CA-95003/16138119_zpid/','10024Monroe-13.jpg'),(14,'unrated','95003','214 Rio Del Mar Blvd.','Aptos','CA',696800,656400,'4','2.5',1306,1550,679000,'2002-11-01','normal','agent','once',113,'Sally Bookman, Keller Williams',0,0,'Built: 1961\r\nMLS #: 	81143217\r\n\r\nJust half block to the sand at Rio del Mar beach, reverse floor plan with outstanding views of the sand, white water, ocean out to Capitola. Large open floor plan, high ceilings, refurbished wrap around decks for views of water in front and hills in back. Has been most successful vacation rental w/documented income. Furnishings can be included. New on the market.\r\n','2012-02-02 18:37:15','2012-02-06 19:58:35','','(831) 457-550',0,'http://www.zillow.com/homedetails/241-Rio-Del-Mar-Blvd-Aptos-CA-95003/16138894_zpid/','214RioDelMar-14.jpg'),(15,'should','95003','1953 Dolphin Dr.','Aptos','CA',525000,618000,'4','3',6098,2380,527000,'2011-09-26','normal','agent','once',43,'Seb Frey, Thunderbird',0,0,'Built: 1978\r\nMLS #: 81126323\r\n\r\nParking: Garage - Attached\r\nThe big time! Roomy all over with ocean peeks from second story. Tile counters, separate office and dining, and outstanding exterior appeal. Convenient Aptos location close to everything!\r\n\r\n\r\n\r\n','2012-02-02 18:43:11','2012-02-06 19:58:49','','',0,'http://www.zillow.com/homedetails/1953-Dolphin-Dr-Aptos-CA-95003/16146430_zpid/','1953Dolphin-15.jpg'),(16,'should','93449','205 Margo Way','Pismo Beach','CA',519000,509200,'3','2',9016,1964,505000,'2003-01-09','normal','agent','once',324,'Linda Hamilton, Academe',0,0,'Built: 1986\r\nMLS #: 174617\r\nHeating: Forced air\r\n\r\nIt\'s a pleasure to come home to this charming & well maintained home in Pismo Beach that features a NEW 30 year roof, beautiful landscaping, relaxing patio, and private backyard. Enjoy peek-a-boo views of the ocean, nice setting, fireplace in the living room, generous bedrooms, spacious family room, and kitchen with lots of storage. NOT an REO or short sale!\r\n\r\n','2012-02-03 00:26:58','2012-02-06 19:52:50','','(805) 461-0888',0,'http://www.zillow.com/homedetails/205-Margo-Way-Pismo-Beach-CA-93449/15392252_zpid/','205Margo-16.jpg'),(17,'unrated','93449','1256 Limerick Ln.','Pismo Beach','CA',599000,586800,'3','2',5314,2170,290000,'1999-05-21','normal','agent','once',115,'Robert Fisher e-PRO, Atlantic & Pacific',0,0,'Built: 1992\r\nHeating: forced air\r\nMLS #: 	180751\r\n\r\nBeautiful Ocean View home in Pismo Beach. Contemporary design with lots of light and an open floor plan. Enjoy the panoramic views from the rear deck and most of the living area. There are vaulted ceilings and 2 fireplaces including a separate family room down stairs. This home has lots of space and is great for entertaining. Close to most services and the beach.','2012-02-03 00:32:09','2012-02-06 19:53:43','','(877) 330-2773',0,'http://www.zillow.com/homedetails/125-Limerick-Ln-Pismo-Beach-CA-93449/15391503_zpid/','1256Limerick-17.jpg'),(18,'unrated','93449','633 Shamrock Ln.','Pismo Beach','CA',599000,614500,'4','2.5',6969,2248,835000,'2007-03-02','normal','agent','once',106,'Dawn Valenti, Keller Williams',0,0,'Built: 1990\r\nMLS #: 181009\r\n\r\nBeautiful Ocean View home in Pismo Beach. Open floor plan with nice light and ocean views from most areas of the home and decks. There are vaulted ceilings and 2 fireplaces. This spacious home has great potential, fantastic ocean views, low maintenance landscape complete with water fall and koi pond. Close to shopping, restaurants, public transportation, and the beach.\r\n\r\n','2012-02-03 00:37:38','2012-02-06 19:54:19','','(805) 773-7777',0,'http://www.zillow.com/homedetails/633-Shamrock-Ln-Pismo-Beach-CA-93449/15391491_zpid/','633Shamrock-18.jpg'),(19,'should','93449','105 Limerick Ln.','Pismo Beach','CA',650000,631600,'4','3',6359,2316,270000,'1996-02-07','normal','agent','once',115,'Lisa Delaney, Keller Williams',0,0,'Built: 1989\r\nMLS #: 	182653\r\n\r\nDon\'t take this view for granted!! Amazing ocean views from this custom home in Pismo Beach. Located on a quiet cul-de-sac, this home features cathedral ceilings, spacious and open kitchen, master bedroom with fireplace and walk-in closet w/dressing area. Spectacular ocean views can been enjoyed from most rooms. The beautiful, expansive backyard decking is perfect for entertaining or relaxing. Great location; close to the beach, shopping, restaurants, schools and public transportation.\r\n\r\nHeating: Forced air\r\n','2012-02-03 00:42:31','2012-02-06 19:54:56','','(805) 773-7777',0,'http://www.zillow.com/homedetails/105-Limerick-Ln-Pismo-Beach-CA-93449/15391498_zpid/','105Limerick-19.jpg'),(20,'should','93433','901 N 5th St.','Grover Beach','CA',529900,467500,'3','2.5',6000,1860,560000,'2004-11-05','normal','agent','once',58,'PIsmo Coast Management & Realty',0,0,'Parking: 	Garage - Attached\r\nHeating: 	Forced air\r\nFireplace: 	Yes\r\n\r\nBeautiful Mediterranean Style Home in desirable gated Mar Brissa in N. Grover Beach just 5 blocks to the ocean. Not a fixer-upper, foreclosure, or short sale! Move-in ready. Includes:1900 Sq Ft (approx), 3 bed/ 2.5 Baths, full kitchen remodel in 2005, lots of windows to enjoy views, large deck with Hot Springs spa. Office Exclusive.','2012-02-03 01:05:27','2012-02-03 17:53:30','','805-773-6990 ',0,'http://www.zillow.com/homedetails/901-N-5th-St-Grover-Beach-CA-93433/15435146_zpid/','901N5th-20.jpg'),(21,'should','93433','962 Marguerita Ave.','Grover Beach','CA',535000,519700,'4','4',13775,2570,599500,'2004-01-30','normal','agent','once',15,'Sheila Hardy, Hometown Realty',0,0,'Built: 1990\r\nMLS #: 182866\r\nHeating: Forced air\r\n\r\nLocated in desired neighborhood of North Grover Beach, just 12 blocks to the Ocean and minutes to the historic charming Village of Arroyo Grande and World Class Vineyards of the Edna Valley. This 4 bedroom, 3 bath Architectural Dream home has Gorgeous Views and Sunsets from any one of its many balconies or patio decks. It\'s Open Floorplan features a Spacious Kitchen with island, double ovens, pantry and corner window to take advantage of the views, a formal dining room with French Doors to patio & balcony, family room with warm and cozy fireplace and beautiful picture windows with views to the lovely manicured backyard Oak Trees a perfect setting to entertain your guests in. Double Car Garage with loft inside for extra storage, shed in backyard that has electricity that has been used for office, could be workshop, storage, or ? Plenty of room for pets, kids and gardening.\r\n\r\n','2012-02-03 01:11:09','2012-02-06 19:51:55','805.­235.0328','805.­489.2100',0,'http://www.zillow.com/homedetails/962-Margarita-Ave-Grover-Beach-CA-93433/15432569_zpid/','962Marguerita-21.jpg'),(22,'must','93449','531 Harloe Ave.','Pismo Beach','CA',595000,550200,'3','2',5500,1723,0,'2012-02-03','normal','agent','once',751,'Glenda Bombini, Hometown Realty',0,0,'Built: 1950\r\nMLS #: 160371\r\n\r\nThe builders maximized the living and storage space on this downtown home. 1723 square feet of living space with a low maintenance yard on a large piece of Pismo Beach. Single level with two full baths. Carport for trailers, plus additional parking. Well maintained home. Put this on your list of homes to see.\r\n','2012-02-03 01:18:40','2012-02-06 19:55:14','','805.­773.2100',0,'http://www.zillow.com/homedetails/531-Harloe-Ave-Pismo-Beach-CA-93449/15390586_zpid/','531Harloe-22.jpg'),(23,'should','93449','498 Selma St.','Pismo Beach','CA',498000,513100,'3','2',5000,1861,221000,'1989-05-17','normal','agent','once',219,'Mona Steen, Hometown Realty',0,0,'Built: 1989\r\nMLS #: 177957\r\n\r\nGreat 3 bedroom home just minutes to the pier. Tucked away on a cul-de-sac with gorgeous views of the mountains and a peek at the ocean. Walk or bike to the pier.This comfortable home is close to shopping,freeway and minutes to SLO. Take a look you will love it!\r\nHeating: Forced air','2012-02-03 01:24:18','2012-02-06 19:56:20','805.­441.1993','805.­489.2100',0,'http://www.zillow.com/homedetails/220-Selma-St-Pismo-Be