','agent','once',2,'Nick & Jeanne Vrolyk, American Dream',0,0,'Built: 1961\r\nMLS #: 	hm_660542\r\n\r\nLIVE OAK - SANTA CRUZ - Single story 3 BR, 2 BA home on large lot on appealing street. Enjoy extra large family room, and detached 2 car garage.\r\n\r\n','2012-02-04 01:40:39','2012-02-04 19:56:44','','',0,'http://www.zillow.com/homedetails/1835-15th-Ave-Santa-Cruz-CA-95062/16124001_zpid/','1835-15th-32.jpg'),(34,'unrated','95060','101 Cardiff Pl.','Santa Cruz','CA',639000,562700,'3','3',4791,1732,0,'2012-02-04','normal','agent','once',2,'Amy Gilbert, American Dream',0,0,'Built: 1976\r\nMLS #: 	81203939\r\n\r\nUpper west side home near ucsc. home has great layout with large living area with wetbar. Large master bedroom with good sized master bath. Wonderful private back yard with bbq area. Near park with tennis courts. Please come by and take a look!\r\n\r\nOpen house: Sat 02/04, 1:00am - 4:00am ','2012-02-04 01:45:44','2012-02-06 20:07:20','','(831) 438-5700',0,'http://www.zillow.com/homedetails/101-Cardiff-Pl-Santa-Cruz-CA-95060/16102115_zpid/','101Cardiff-33.jpg'),(35,'unrated','95003','911 Vista Del Mar Dr.','Aptos','CA',479000,490200,'3','2',9583,1714,240000,'2011-11-04','normal','agent','once',3,'owner',0,0,'Built: 1976\r\n\r\n\r\nWith 22 windows and glass doors this home is well lit with natural light. Very bright and cheery, even on cloudy days. Only 1.6 miles to beautiful beach access with free street parking and miles of open beach to walk, jog, surf, swim, bicycle or fish on. More pictures @: http://claspics.com/vbmfufz/gxzrtyld/ Details regarding the home: - 3 decks, two in rear of home have gorgeous views (see pics) - 300 sq ft artist studio / bonus room - 2 of the bedrooms are extremely spacious (13 x 24 ft) with 12ft long closets - 3rd bedroom is 12 x 12 ft with 8 ft long closet - Upstairs bath with 2 sinks and floor to ceiling linen cabinet - Downstairs bath is quite large as a combo bath room / laundry room. Washer / dryer hook ups are set back within separate enclosure. - 20 linear feet of counter space in extra wide galley style kitchen - Dining area off of kitchen area has room for 6 to 8 chair table - Large family room / den with wood burning stove and beautiful views off adjoining deck Utilities: - Home is all electric with PG & E service - Green Waste Management for trash, green matter and recycling - Excellent cell phone reception unlike many other areas in Rio Del Mar, Seascape & Aptos. This is an important consideration if you depend greatly on your smart / cell phone for business purposes. - 1500 gallon septic tank with two 40ft deep vertical leech fields. Has plenty of capacity for home of this size. Bonus Room: - Bonus room is accessible down exterior stairs. - Completely separate / private from main home living quarters, although attached to the main structure - New laminate flooring - Two view windows and 9 foot ceilings. - Cable, phone and power are all present. About the Re-model: - Complete exterior and interior paint. - New double pane glass windows (19 windows) and 10 foot wide double pane, 3 panel slider doors (3 total) to optimize natural lighting and views. - Gorgeous solid wood cabinets with self closing doors and drawers - All new kitchen appliances (Maytag dishwasher, refrigerator, convection range and microwave) - New baseboard heaters with wall thermostats and downstairs electronically controlled wall heater with remote control - 900 sq ft of 18\" travertine flooring. All downstairs and both bathrooms - All new light fixtures and ceiling fans - Upgraded granite counter tops in kitchen and bathrooms - New bathtub and travertine surrounds to ceiling in upstairs bath - New shower travertine shower surrounds to ceiling in down stairs bath (also location of washer / dryer hook up) - All new kitchen, bathroom sink and shower faucet fixtures - New carpet (stairs, upstairs hall and bedrooms) - New smoke and carbon dioxide detectors - New water heater - New can lighting in kitchen The remodeling contractors we used possess incredible craftsmanship and payed much attention to detail and it shows. About the lot and setting: - Home is situated on the hill side with minimal yard space so in turn, requires minimal lawn maintenance - Very close to shopping, incredible restaurants, state parks, etc... - Plenty of room on the lot to build a large ground level deck at rear of home if desired - Large space (20 to 35 ft.) between both neighbors homes - House sits higher on the hillside than neighbors for additional privacy - Plenty of parking space (Up to 3 full size trucks and a sedan) Location / Logistics: - Close access to dog walking and bike riding trails - Only a few minutes from Rio Del Mar Elementary school. (1.1 miles) - Close to Cabrillo College (4 miles) - Under an hour to downtown San Jose (40 miles) - Close to public bus stop (.8 miles) - Close to shopping / restaurants in Watsonville (6-8 miles down Highway 1) - Close to Monterrey (33 miles) - 80 miles to San Francisco - Close to Capitola (6 miles) About the sale: - Accepting offers from pre-approved buyers only - Offering 2.5 points to buyers agent - No owner carry back available - Will consider lease to own with sizable down payment -Please respond with your phone number.','2012-02-04 01:51:38','2012-02-06 19:59:20','','(530) 277-5371',0,'http://www.zillow.com/homedetails/911-Vista-Del-Mar-Dr-Aptos-CA-95003/16140483_zpid/','911VistaDelMar-34.jpg'),(36,'unrated','95003','449 Loma Prieta Dr.','Aptos','CA',442000,454400,'3','3',20473,1442,165000,'2011-06-08','normal','agent','once',2,'Sandy Kaplan-Mason, Santa Cruz Properties',0,0,'Built: 1940\r\nMLS #: 	81203683\r\nrecent rebuild\r\n\r\nSignificant remodel with permits in 2011...new roof, new septic, cement siding, on demand water heater, new paint, tile and carpet. The kitchen has stainless steel appliances, new cabinets & granite counters. What\'s not to like? Lots of high quality upgrades including elegant MBA with jacuzzi tub. Very private and p